import axios from 'axios';

const fetchPumps = async () => {
  try {
    const response = await axios.get('http://localhost:5000/api/pumps');
    console.log(response.data); // Handle the data here
  } catch (error) {
    console.error("Error fetching pumps:", error);
  }
};
